const tintColorLight = "#2f95dc";
const tintColorDark = "#fff";

export default {
  light: {
    dedalBlue : '#294F87',
    dedalBlue : '#2F5B9E',
    ValidateGreen : '#03C923',
    ErrorRed : '#FF0000',
    White : '#FFFFFF',
    Black : '#1D1D1D',
  },
  dark: {
    text: "#FFFFFF",
    background: "#0A212A",
    tint: tintColorDark,
    tabIconDefault: "#ccc",
    tabIconSelected: tintColorDark,
  },
};
